<template>
  <div>
    <canvas id="c" width="1280" height="1812"></canvas>
  </div>
</template>

<script setup>
onMounted(() => {
  var canvas = document.getElementById("c");
  var ctx = canvas.getContext("2d");

  var image = new Image();
  image.onload = function() {
    ctx.drawImage(image, 0, 0);
  };
  image.src = "data:image/png;base64,";
})

</script>

